script: |
  super -f text -I q9540.spq | sort > q9540.out

inputs:
  - name: q9540.spq
    data: |
      SELECT * FROM tab2 (FORMAT parquet) AS cor0 WHERE 50 NOT BETWEEN + - col2 AND + + 34 * - col1 * - 76 * - 52;
  - name: tab2

outputs:
  - name: q9540.out
    data: |
      46	51	23
      64	77	40
      75	67	58
